import { Navigation, Pagination, Scrollbar, A11y } from 'swiper';
import { Swiper, SwiperSlide } from 'swiper/react';
// Import Swiper styles
import { useState } from 'react/cjs/react.production.min';
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';

export function CatSwiper(props) {
  const [breedCat,setBreedcat] = useState('')
  setBreedcatprops.breedCat

  const cat = props.breedCat
  console.log(cat)
  const breedcatimg = cat.map((cat) => {
    <SwiperSlide key={cat}>
     <img src={cat}></img>
    </SwiperSlide>
  })

  return (
    <Swiper
      // install Swiper modules
      modules={[Navigation, Pagination, Scrollbar, A11y]}
      spaceBetween={50}
      slidesPerView={1}
      navigation
      pagination={{ clickable: true }}
      scrollbar={{ draggable: true }}
      onSwiper={props.breedImage}
      onSlideChange={breedcatimg}

    >
      <img src={props.breedCat}></img>
        {/* {breedcatimg} */}
      ...
    </Swiper>
  )
}
export default CatSwiper;
